import React from 'react';

const Form = (props) => {
	return (
		<form onSubmit={props.loadweather}>
			<div className='row'>
				<input
					type='text'
					className='form-control'
					placeholder='Enter City...'
					name='city'
				/>
				<div className='btn-group' role='group' aria-label='Basic example'>
					<button
						type='submit'
						className='btn btn-outline-info secondary-content'
					>
						Find
					</button>
				</div>
			</div>
		</form>
	);
};

export default Form;
